I suspect [here](https://github.com/tensorflow/tensorflow/blob/41b93a8b310086f69aab6b6369d2af9d5178881d/tensorflow/core/ops/math_ops.cc#L1895-L1900), a shape function of `DenseBincount`:
```C++
      if (c->Rank(c->input(0)) == 1) {
        c->set_output(0, c->MakeShape({size_val}));
      } else if (c->Rank(c->input(0)) == 2) {
        c->set_output(0, c->MakeShape({c->Dim(c->input(0), 0), size_val}));
      }
      return absl::OkStatus();
```
Because it assumes 1 or 2 ranked input tensors only, 0-ranked input tensor makes output unset.
How about to add a guard so that it can make sure only 1 or 2 ranked input tensors reach there?

