@drewshark, Please note that the API tf.argmin accepts axis as Tensor unlike argmax which accepts integer. If you pass a boolean Tensor for `tf.argmin` then it will raise error below.
`InvalidArgumentError: Value for attr 'Tidx' of bool is not in the list of allowed values: int32, int64`

 However if we pass python boolean then its accepting same.This behaviour also different and needs a fix IMO.

Since support here is awful and not able to respond during several months, I will post a solution here, maybe it will be useful for somebody. The problem was that `Ops.create()` creates an internal eager session under the hood and all createdconstants are stored there. To fix it we need to move ops creation inside the loop and create a different session every time for it. like
```
EagerSession eagerSession = EagerSession.create();
Ops ops = Ops.create(eagerSession);
```
with this approach memory is stable and not growing

